def three_d_plot(data): # functie om rijen van n=3 te plotten in 3D
    if len(list) == 3:
        xval = [k[0] for k in data] # coordinaten uit lijst nemen
        yval = [k[1] for k in data]
        zval = [k[2] for k in data]
        plt.figure()
        plt.axes(projection = "3d") # 3D-projectie modus aanzetten
        plt.plot(xval, yval, zval, "-o") #plot genereren
        plt.show() #toont grafiek
    else:
        return

def vfunc(list1): # recursieve functie waarmee berekeningen worden gemaakt
    list2 = [] # lege lijst om uitkomst in op te slaan

    for i in range(len(list1)): # gaat lijst af en voert berekening uit
        if i == len(list1)-1:
            verschil = abs(list1[i]-list1[0])
        else:
            verschil = abs(list1[i]-list1[i+1])
        list2.append(verschil)
    savedlists.append(list2)
    length = len(savedlists)
    if all(v == 0 for v in list2): #Test voor uitdovende rijen
        print("Uitdovend na " + str(length) + " iteraties")
        print(savedlists) #uitkomst
        three_d_plot(savedlists)
        return length;
    elif 2 in set([savedlists.count(n) for n in savedlists]):  #Test voor cyclische rijen via "savedlists"
        print("Cyclisch na " +str(length) + " iteraties")
        print(savedlists) # uitkomst
        three_d_plot(savedlists)
        return length;

    vfunc(list2)



vfunc(list)
